import React from 'react';
import carsService from '../services/carsService';

class Home extends React.PureComponent {
  state = {
    cars: []
  };
  getData = () => {
    const session = JSON.parse(localStorage.getItem('session'));
    const headers = {
      Authorization: `Bearer ${session.access_token}`
    };
    carsService
      .getData({ headers })
      .then(res => {
        this.setState({ cars: res.data });
      })
      .catch(e => {
        console.log(e);
      });
  };
  removeCar = id => {
    console.log(id);
  };
  render() {
    console.log(this.state);
    return (
      <div>
        <section className='home-landing'>
          <div className='dark-overlay'>
            <div className='landing-inner'>
              <h1 className='large'>PUSH THE BUTTON, CHANGE THE CHANNEL</h1>
              <img
                class='slicica'
                src='https://static.independent.co.uk/s3fs-public/thumbnails/image/2017/04/08/10/freida-pinto.jpg?w968h681'
                alt='moja slika'
              />
              <button className='btn btn-primary' onClick={this.getData}>
                LOAD CARS
              </button>
              {this.state.cars.map(car => {
                return <img key={car.name} src={car.image} />;
              })}
            </div>
          </div>
          <div></div>
        </section>
      </div>
    );
  }
}

export default Home;
